import { AngularFirestore } from '@angular/fire/firestore';
import { Injectable } from '@angular/core';
import { map } from 'rxjs/operators';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root',
})
export class ImageService {
  constructor(private afs: AngularFirestore) {}

  public getAllReportRightHeaderImages() {
    return this.afs
      .collection('images', (ref) => ref.where('reportRightHeader', '==', true))
      .snapshotChanges()
      .pipe(
        map((actions) =>
          actions.map((a) => {
            const data = a.payload.doc.data() as any;
            const id = a.payload.doc.id;
            return { id, ...data };
          })
        )
      );
  }

  public addNewImage(values: any): Observable<any> {
    return new Observable<any>((observer) => {
      const docRef = this.afs.collection(`images`);
      docRef.add(values).then(
        (res) => {
          console.log(res.id);

          observer.next(res);
          observer.complete();
        },
        (err) => {
          observer.error(err);
        }
      );
    });
  }

  deleteImage(id: string) {
    return new Observable<any>((observer) => {
      const docRef = this.afs.doc(`images/${id}`);
      docRef.delete().then(
        (res) => {
          observer.next(res);
          observer.complete();
        },
        (err) => {
          observer.error(err);
        }
      );
    });
  }

  imageHeader =
    'data:image/jpeg;base64,';
}
